import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, TouchableOpacity, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <StatusBar style="auto" />
      <View>
        <TouchableOpacity>
          <Text style={styles.keys}>1</Text>
        </TouchableOpacity>
        <TouchableOpacity>
          <Text style={styles.keys}>1</Text>
        </TouchableOpacity>
        <TouchableOpacity>
          <Text style={styles.keys}>1</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#ccc',
    alignItems: 'center',
    justifyContent: 'center',
  },
  keys: {
    display: "flex",
    backgroundColor: '#f00',
    alignItems: 'center',
    justifyContent: 'center',
    flexDirection: "row",
    borderWidth: 1,
    borderColor: 'aaa',
    fontSize: 35,
    color: '#fff',
    width: 100,
    height: 100,

  }
});
